import './DashBoard.css'
import {useStudentContext} from '../../context/Context';
import {Pie, PieChart} from 'recharts';

const DashBoard = () => { //다음 기회에
    const context = useStudentContext();
    const data = []
    return (
        <div className={'DashBoard'}>
            <div id={'DashBoard_Text'}>
                여기엔 자유롭게 대시보드를 만들어 주세요
            </div>
            {context.studentData.length === 0 ? null : <PieChart width={730} height={250}>
                <Pie data={context.studentData} dataKey="grade" nameKey="name" cx="50%" cy="50%" outerRadius={100}
                     fill="#8884d8"/>
            </PieChart>}

        </div>
    )
}

export default DashBoard
